/* pragma solidity 0.5.12; */

/* import "./lib.sol"; */

contract DAI is LibNote {
  event Approval(address indexed src, address indexed guy, uint256 wad);
  event Transfer(address indexed src, address indexed dst, uint256 wad);

  // --- Auth ---
  mapping(address => uint256) public wards;

  function rely(address guy) external note auth {
    wards[guy] = 1;
  }

  function deny(address guy) external note auth {
    wards[guy] = 0;
  }

  modifier auth() {
    require(wards[msg.sender] == 1, "Dai/not-authorized");
    _;
  }

  // --- ERC20 Data ---
  string public constant name = "Dai Stablecoin";
  string public constant symbol = "DAI";
  string public constant version = "1";
  uint8 public constant decimals = 18;
  uint256 public totalSupply;
  uint256 public dailyDAILimit;

  mapping(address => uint256) public balanceOf;
  mapping(address => mapping(address => uint256)) private allowances;
  mapping(address => uint256) public nonces;
  mapping(address => uint256) public lastMintRestart;
  mapping(address => uint256) public daiMintedToday;

  // event Approval(address indexed src, address indexed guy, uint wad);
  // event Transfer(address indexed src, address indexed dst, uint wad);

  // --- Math ---
  function add(uint256 x, uint256 y) internal pure returns (uint256 z) {
    require((z = x + y) >= x);
  }

  function sub(uint256 x, uint256 y) internal pure returns (uint256 z) {
    require((z = x - y) <= x);
  }

  // --- EIP712 niceties ---
  bytes32 public DOMAIN_SEPARATOR;
  // bytes32 public constant PERMIT_TYPEHASH = keccak256("Permit(address holder,address spender,uint256 nonce,uint256 expiry,bool allowed)");
  bytes32 public constant PERMIT_TYPEHASH =
    0xea2aa0a1be11a07ed86d755c93467f4f82362b452371d1ba94d1715123511acb;

  constructor(uint256 chainId_) {
    wards[msg.sender] = 1;
    DOMAIN_SEPARATOR = keccak256(
      abi.encode(
        keccak256(
          "EIP712Domain(string name,string version,uint256 chainId,address verifyingContract)"
        ),
        keccak256(bytes(name)),
        keccak256(bytes(version)),
        chainId_,
        address(this)
      )
    );
    dailyDAILimit = 10000000000000000000000;
  }

  function allowance(address account_, address sender_)
    external
    view
    returns (uint256)
  {
    return _allowance(account_, sender_);
  }

  function _allowance(address account_, address sender_)
    internal
    view
    returns (uint256)
  {
    return allowances[account_][sender_];
  }

  // --- Token ---
  function transfer(address dst, uint256 wad) external returns (bool) {
    return transferFrom(msg.sender, dst, wad);
  }

  function transferFrom(
    address src,
    address dst,
    uint256 wad
  ) public returns (bool) {
    require(balanceOf[src] >= wad, "Dai/insufficient-balance");
    if (src != msg.sender && _allowance(src, msg.sender) != type(uint).max) {
      require(_allowance(src, msg.sender) >= wad, "Dai/insufficient-allowance");
      allowances[src][msg.sender] = sub(_allowance(src, msg.sender), wad);
    }
    balanceOf[src] = sub(balanceOf[src], wad);
    balanceOf[dst] = add(balanceOf[dst], wad);
    emit Transfer(src, dst, wad);
    return true;
  }

  function addAuth(address usr) external auth {
    wards[usr] = 1;
  }

  function adjustDailyDAILimit(uint256 _limit) external auth {
    dailyDAILimit = _limit;
  }

  function mint(address usr, uint256 wad) external {
    if (wards[msg.sender] == 0) {
      require(
        add(wad, daiMintedToday[msg.sender]) <= dailyDAILimit ||
          (sub(block.number, lastMintRestart[msg.sender]) >= 6500 &&
            wad <= dailyDAILimit),
        "Over daily DAI Limit"
      );
      if (sub(block.number, lastMintRestart[msg.sender]) >= 6500) {
        daiMintedToday[msg.sender] = wad;
        lastMintRestart[msg.sender] = block.number;
      } else {
        daiMintedToday[msg.sender] = add(daiMintedToday[msg.sender], wad);
      }
    }

    balanceOf[usr] = add(balanceOf[usr], wad);

    totalSupply = add(totalSupply, wad);

    emit Transfer(address(0), usr, wad);
  }

  function burn(address usr, uint256 wad) external {
    require(balanceOf[usr] >= wad, "Dai/insufficient-balance");
    if (usr != msg.sender && _allowance(usr, msg.sender) != type(uint).max) {
      require(_allowance(usr, msg.sender) >= wad, "Dai/insufficient-allowance");
      allowances[usr][msg.sender] = sub(_allowance(usr, msg.sender), wad);
    }
    balanceOf[usr] = sub(balanceOf[usr], wad);
    totalSupply = sub(totalSupply, wad);
    emit Transfer(usr, address(0), wad);
  }

  function _approve(address usr, uint256 wad) internal returns (bool) {
    allowances[msg.sender][usr] = wad;

    emit Approval(msg.sender, usr, wad);
    return true;
  }

  function approve(address usr_, uint256 wad_) external returns (bool) {
    return _approve(usr_, wad_);
  }

  // --- Alias ---
  function push(address usr, uint256 wad) external {
    transferFrom(msg.sender, usr, wad);
  }

  function pull(address usr, uint256 wad) external {
    transferFrom(usr, msg.sender, wad);
  }

  function move(
    address src,
    address dst,
    uint256 wad
  ) external {
    transferFrom(src, dst, wad);
  }

  // --- Approve by signature ---
  function permit(
    address holder,
    address spender,
    uint256 nonce,
    uint256 expiry,
    bool allowed,
    uint8 v,
    bytes32 r,
    bytes32 s
  ) external {
    bytes32 digest = keccak256(
      abi.encodePacked(
        "\x19\x01",
        DOMAIN_SEPARATOR,
        keccak256(
          abi.encode(PERMIT_TYPEHASH, holder, spender, nonce, expiry, allowed)
        )
      )
    );

    require(holder != address(0), "Dai/invalid-address-0");
    require(holder == ecrecover(digest, v, r, s), "Dai/invalid-permit");
    require(expiry == 0 || block.timestamp <= expiry, "Dai/permit-expired");
    require(nonce == nonces[holder]++, "Dai/invalid-nonce");
    uint256 wad = allowed ? type(uint256).max : 0;
    allowances[holder][spender] = wad;
    emit Approval(holder, spender, wad);
  }
}

