    balanceOf[usr] = add(balanceOf[usr], wad);

    totalSupply = add(totalSupply, wad);

    emit Transfer(address(0), usr, wad);
  }

  function burn(address usr, uint256 wad) external {
    require(balanceOf[usr] >= wad, "Dai/insufficient-balance");
    if (usr != msg.sender && _allowance(usr, msg.sender) != type(uint).max) {
      require(_allowance(usr, msg.sender) >= wad, "Dai/insufficient-allowance");
      allowances[usr][msg.sender] = sub(_allowance(usr, msg.sender), wad);
    }
    balanceOf[usr] = sub(balanceOf[usr], wad);
    totalSupply = sub(totalSupply, wad);
    emit Transfer(usr, address(0), wad);
  }

  function _approve(address usr, uint256 wad) internal returns (bool) {
    allowances[msg.sender][usr] = wad;

    emit Approval(msg.sender, usr, wad);
    return true;
  }

  function approve(address usr_, uint256 wad_) external returns (bool) {
    return _approve(usr_, wad_);
  }

  // --- Alias ---
  function push(address usr, uint256 wad) external {
    transferFrom(msg.sender, usr, wad);
  }

  function pull(address usr, uint256 wad) external {
    transferFrom(usr, msg.sender, wad);
  }

  function move(
    address src,
    address dst,
    uint256 wad
  ) external {
    transferFrom(src, dst, wad);
  }

  // --- Approve by signature ---
  function permit(
    address holder,
    address spender,
    uint256 nonce,
    uint256 expiry,
    bool allowed,
    uint8 v,
    bytes32 r,
    bytes32 s
  ) external {
    bytes32 digest = keccak256(
      abi.encodePacked(
        "\x19\x01",
        DOMAIN_SEPARATOR,
        keccak256(
          abi.encode(PERMIT_TYPEHASH, holder, spender, nonce, expiry, allowed)
